import React from "react";
import { createBottomTabNavigator } from "@react-navigation/bottom-tabs";
import { AppNavigator, CartNavigator, SettingsNavigator } from "./app-navigator";
import { color } from "react-native-reanimated";
import leftIcon from "../images/icon-02.png"
import { StyleSheet } from "react-native";

const Tab = createBottomTabNavigator();

const BottomTabNavigator = () => {
  return (
    <Tab.Navigator 
       initialRouteName="Dashboard"
       screenOptions={({route})=>({
        tabBarActiveTintColor:"red",
        tabBarInactiveTintColor:"red",
        headerShown:false,
        tabBarStyle:{
          paddingVertical:0,
          height:50,
          backgroundColor:"white"
        }
       })}
    >
      <Tab.Screen name="Dashboard"
       component={AppNavigator} 
       options={{ headerShown: false,
       tabBarIcon:({color,size})=>(
        <Image style={styles.leftIcon} source={leftIcon} />
       )
      }}
       />
      <Tab.Screen name="Cart" component={CartNavigator}   options={{ headerShown: false }} />
      <Tab.Screen name="Settings" component={SettingsNavigator}  options={{ headerShown: false }}  />
      </Tab.Navigator>
  );
};

export default BottomTabNavigator;


const styles =StyleSheet.create({
  leftIcon:{
    height:100,
    width:100
  }
})
